    LANGUAGE plpgsql
    AS $$
BEGIN
    IF (TG_OP = 'UPDATE' AND OLD.estado_validacion IS DISTINCT FROM NEW.estado_validacion) THEN
        INSERT INTO auditoria_validaciones (
            id_req_per,
            num_reg_per,
            estado_anterior,
            estado_nuevo,
            validado_por,
            comentario
        ) VALUES (
            NEW.id_req_per,
            NEW.num_reg_per,
            OLD.estado_validacion,
            NEW.estado_validacion,
            NEW.validado_por,
            NEW.comentario_validacion
        );
    END IF;
    RETURN NEW;
END;
$$;


