--
-- TOC entry 268 (class 1259 OID 18310)
-- Name: v_estadisticas_validacion; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_estadisticas_validacion AS
 SELECT e.id_evt,
    e.nom_evt AS nombre_evento,
    det.id_det,
    count(DISTINCT reg.num_reg_per) AS total_registros,
    count(DISTINCT
        CASE
            WHEN ((reg.estado_registro)::text = 'PRE-REGISTRO'::text) THEN reg.num_reg_per
            ELSE NULL::integer
        END) AS pre_registros,
    count(DISTINCT
        CASE
            WHEN ((reg.estado_registro)::text = 'REQUISITOS_COMPLETOS'::text) THEN reg.num_reg_per
            ELSE NULL::integer
        END) AS requisitos_completos,
    count(DISTINCT
        CASE
            WHEN ((reg.estado_registro)::text = 'COMPLETADO'::text) THEN reg.num_reg_per
            ELSE NULL::integer
        END) AS completados,
    count(DISTINCT
        CASE
            WHEN ((reg.estado_registro)::text = 'REQUISITOS_RECHAZADOS'::text) THEN reg.num_reg_per
            ELSE NULL::integer
        END) AS rechazados,
    count(
        CASE
            WHEN ((rp.estado_validacion)::text = 'PENDIENTE'::text) THEN 1
            ELSE NULL::integer
        END) AS requisitos_pendientes,
    count(
        CASE
            WHEN ((rp.estado_validacion)::text = 'APROBADO'::text) THEN 1
            ELSE NULL::integer
        END) AS requisitos_aprobados,
    count(
        CASE
            WHEN ((rp.estado_validacion)::text = 'RECHAZADO'::text) THEN 1
            ELSE NULL::integer
        END) AS requisitos_rechazados
   FROM ((((public.eventos e
     JOIN public.detalle_eventos det ON (((e.id_evt)::text = (det.id_evt_per)::text)))
     LEFT JOIN public.registro_evento reg_evt ON (((det.id_det)::text = (reg_evt.id_det)::text)))
     LEFT JOIN public.registro_personas reg ON (((reg_evt.id_reg_evt)::text = (reg.id_reg_evt)::text)))
     LEFT JOIN public.requisitos_persona rp ON ((reg.num_reg_per = rp.num_reg_per)))
  GROUP BY e.id_evt, e.nom_evt, det.id_det
  ORDER BY e.nom_evt;


ALTER VIEW public.v_estadisticas_validacion OWNER TO postgres;

--
-- TOC entry 267 (class 1259 OID 18305)
-- Name: v_requisitos_pendientes; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_requisitos_pendientes AS
 SELECT rp.id_req_per,
    rp.num_reg_per,
    rp.id_req,
    rp.val_req AS archivo_url,
    rp.estado_validacion,
    rp.fecha_validacion,
    rp.comentario_validacion,
    re.tip_req AS nombre_requisito,
    re.des_req AS descripcion_requisito,
    re.obligatorio,
    reg.id_usu AS id_estudiante,
    u.nom_usu AS nombre_estudiante,
    u.ape_usu AS apellido_estudiante,
    det.id_det,
    e.nom_evt AS nombre_evento,
    e.id_res_evt AS id_responsable_evento,
    resp.nom_usu AS nombre_responsable,
    reg.estado_registro
   FROM (((((((public.requisitos_persona rp
     JOIN public.requisitos_evento re ON ((rp.id_req = re.id_req)))
     JOIN public.registro_personas reg ON ((rp.num_reg_per = reg.num_reg_per)))
     JOIN public.usuarios u ON ((reg.id_usu = u.id_usu)))
     JOIN public.registro_evento reg_evt ON (((reg.id_reg_evt)::text = (reg_evt.id_reg_evt)::text)))
     JOIN public.detalle_eventos det ON (((reg_evt.id_det)::text = (det.id_det)::text)))
     JOIN public.eventos e ON (((det.id_evt_per)::text = (e.id_evt)::text)))
     LEFT JOIN public.usuarios resp ON ((e.id_res_evt = resp.id_usu)))
  WHERE (((rp.estado_validacion)::text = 'PENDIENTE'::text) AND (rp.val_req IS NOT NULL))
  ORDER BY rp.fec_val DESC;


ALTER VIEW public.v_requisitos_pendientes OWNER TO postgres;

--
-- TOC entry 238 (class 1259 OID 17621)
